import React from "react";

const VisibilityFilter = ({ todos }) => {
  console.log("todos :", todos);
  return (
    <div>
      <h2>VISIBILITY FILTER</h2>

      <button>All</button>
      <button>Completed</button>
      <button>Not Completed</button>
    </div>
  );
};


export default VisibilityFilter;
